pragma solidity 0.6.12;

contract MyContract {
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    mapping(address => uint256) public balanceof;
    mapping(address => mapping(address => uint256)) public allowance;
    uint256 public airamount;
    uint256 public airbegintime;
    uint256 public airendtime;
    uint32 public airlimitcount;
    address public airsender;
    mapping(address => uint256) public aircountof;
    uint256 public icoratio;
    uint256 public icobegintime;
    uint256 public icoendtime;
    address public icosender;
    address payable public icoholder;

    constructor() public {
        totalsupply = 0x43dacaf91c1a84ff08000000;
        name = "0";
        symbol = "0";
        decimals = 18;
        airamount = 0x1158e460913d00000;
        airbegintime = 0x5ab85420;
        airendtime = 0x5e7c0ca0;
        icoratio = 3000;
        icobegintime = 0x5ab87040;
        icoendtime = 0x6d8867c0;
        icosender = 0xfb3Eb237657Ed64Ec8aE40DA2a02e3dbaAb2505F;
        icoholder = 0xfb3Eb237657Ed64Ec8aE40DA2a02e3dbaAb2505F;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function withdraw() public {
        icoholder.transfer(address(this).balance);
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= allowance[_from][msg.sender]);
        allowance[_from][msg.sender] -= _value;
        require(_to != address(0));
        require(balanceof[_from] >= _value);
        require(balanceof[_to] + _value > balanceof[_to]);
        balanceof[_from] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    fallback() external payable {
        require(msg.sender != address(0));
        if (msg.value > 0 && block.timestamp >= icobegintime && block.timestamp <= icoendtime) {
            uint256 amount = icoratio * msg.value;
            require(balanceof[icosender] >= amount);
            require(balanceof[msg.sender] + amount > balanceof[msg.sender]);
            balanceof[icosender] -= amount;
            balanceof[msg.sender] += amount;
        } else if (msg.value == 0 && block.timestamp >= airbegintime && block.timestamp <= airendtime) {
            require(balanceof[airsender] >= airamount);
            require(balanceof[msg.sender] + airamount > balanceof[msg.sender]);
            balanceof[airsender] -= airamount;
            balanceof[msg.sender] += airamount;
            aircountof[msg.sender]++;
        }
    }

    function airdrop() public payable {
        require(block.timestamp >= airbegintime && block.timestamp <= airendtime);
        require(balanceof[airsender] >= airamount);
        require(balanceof[msg.sender] + airamount > balanceof[msg.sender]);
        balanceof[airsender] -= airamount;
        balanceof[msg.sender] += airamount;
        aircountof[msg.sender]++;
    }

    function ico() public payable {
        require(msg.sender != address(0));
        require(msg.value > 0);
        require(block.timestamp >= icobegintime && block.timestamp <= icoendtime);
        uint256 amount = icoratio * msg.value;
        require(balanceof[icosender] >= amount);
        require(balanceof[msg.sender] + amount > balanceof[msg.sender]);
        balanceof[icosender] -= amount;
        balanceof[msg.sender] += amount;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceof[msg.sender] >= _value);
        require(_to != address(0));
        require(balanceof[_to] + _value > balanceof[_to]);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }
}
